function SVG({
  width,
  height,
  className,
  children,
  viewBox,
}) {
  return (
    <svg
      width={width}
      height={height}
      className={className}
      viewBox={viewBox || '0 0 34 34'}
      fill="none"
      xmlns="http://www.w3.org/2000/svg"
    >
      {children}
    </svg>
  );
}

